import React from 'react';
import { FormControlLabel, Checkbox } from '@mui/material';

const OrderStatus = ({ status}) => {

  return (
    <>
      <span>{status}</span>
      <FormControlLabel
        control={<Checkbox />}
        label="Сортировка"
      />
    </>
  );
};

export default OrderStatus;
